script: |
  super -f text -I q12316.spq | sort > q12316.out

inputs:
  - name: q12316.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col2 + + 80 + ( + - ( + CAST ( NULL AS REAL ) ) ) / - CAST ( NULL AS INTEGER ) - col1 * + - col0 + + col1 NOT BETWEEN ( - CAST ( - col0 AS INTEGER ) * - + col1 ) AND col0 * - col0 + + col2;
  - name: tab2

outputs:
  - name: q12316.out
    data: |
